import Link from 'next/link';
import { Container, Navbar, Nav, NavDropdown } from 'react-bootstrap';
import styled from 'styled-components';

const Styles = styled.div`
  .navbar {
    background-color: white;
    box-shadow: 0 3px 3px rgba(0, 0, 0, 0.1);
  }
  .navbar-brand {
    display: inline-block;
    float: left;
    text-align: center;
    margin: 0.3em 0;
    width: 250px !important;
  }
  .navbar-brand,
  .navbar-nav,
  .nav-link {
    color: #34495e !important;
    font-size: 0.92em;
    font-weight: bold;
    &:hover {
      color: #ff7964 !important;
    }
  }
  .container {
    padding-right: 15px;
    padding-left: 15px;
    margin-right: auto;
    margin-left: auto;
  }
  .dropdown {
    position: relative;
  }
  .dropdown-item {
    font-size: 0.92em;
    font-weight: bold;
    &:hover {
      color: #ff7964 !important;
    }
  }
  .dropdown > .dropdown-menu {
    margin-top: -10px;
    -webkit-border-radius: 0px 0px 6px 6px;
    -moz-border-radius: 0px 0px 6px;
    border-radius: 0px 0px 6px 6px;
  }
  .dropdown:hover > .dropdown-menu {
    display: block;
  }
`;

const Header = () => (
  <div>
    <Styles>
      <Navbar sticky='top' expand='lg'>
        <Container>
          <Navbar.Brand>
            {/* <img src={Logo} alt='logo_unica' /> */}
          </Navbar.Brand>
          <Navbar.Toggle aria-controls='basic-navbar-nav' />
          <Navbar.Collapse
            className='justify-content-end'
            id='basic-navbar-nav'
          >
            <Nav>
              <Link className='nav-link' href='/'>
                <a>INICIO</a>
              </Link>
              <Link className='nav-link' href='/instalaciones'>
                <a>INSTALACIONES</a>
              </Link>
              <Link className='nav-link' href='/pacientes'>
                <a>INFORMACIÓN A PACIENTES</a>
              </Link>
              <NavDropdown
                title='CONSULTA DE ESPECIALIDADES'
                id='basic-nav-dropdown'
              >
                <Link className='dropdown-item' href='/clinica'>
                  <a>CLÍNICA</a>
                </Link>
                <Link className='dropdown-item' href='/comodin'>
                  <a>FARMACOS Y ARTÍCULOS MÉDICOS DE HERIDAS</a>
                </Link>
              </NavDropdown>
              <Link className='nav-link' href='/contacto'>
                <a>CONTACTO</a>
              </Link>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>
    </Styles>
  </div>
);

export default Header;
